import React, { Component } from "react";

import { Route, Switch, Redirect } from "react-router-dom";
import compose from "recompose/compose";

import { Dashboard as DashboardLayout } from "layouts";
import styles from "./styles";
import { withStyles } from "@material-ui/styles";

class Quiz extends Component {
	render() {
		return (
			<DashboardLayout quiz title="Quiz">
				<Switch>
					<Route exact path="/quiz/:quizId" component={OverviewTab} />
					<Route exact path="/project/:projectId/chat" component={ChatTab} />

					<Redirect to="/project/:projectId/overview" />
				</Switch>
			</DashboardLayout>
		);
	}
}

export default compose(withStyles(styles))(Quiz);
